import { motion } from "framer-motion";
import HomeButton from "../utils/lol";

function Other() {

    return (
        <motion.div
        exit={{opacity: 0}}
        animate={{opacity: 1}}
        initial={{opacity: 0}}
        transition={{duration: 0.8}}
        >
            HAHA
            <HomeButton />
        </motion.div>
    )

}

export default Other;
